(132, 'SkyBlew', 'skyblewmusic@gmail.com', NULL, NULL, NULL, NULL, 'artist', '$2y$10$ys6QtE8xsiiyZshTZf4dMurS0WdqiQhaVIWFmQ9B/XZaRMmk7xZmi', '3366849645', NULL, '@SkyBlewMusic', '*SHOW OF INTEREST - ROLLING LOUD MIAMI*\r\n\r\n\r\nPeace & Love! \r\n\r\nMy name is Mario Farrow and I am representing SkyBlew, a young BUZZING emcee who resides in North Carolina by way of Auburn, Alabama. He is becoming the hip-hop voice for a new generation, with a NEW SOUND…\r\nHis music is very positive and inspirational but it still gets the fans attention with infectious beats and lyrics. This kid sounds like NOTHING out right now! Speaking from his life experiences such as: foster care, homelessness and etc, he uses his message in hopes to make a difference. He chose to rise above the dire circumstances and share his story. SkyBlew also, uniquely incorporates anime, cartoon and video game references/themes into his repertoire to create hip hop like you\'ve never heard before! He doesn\'t want to put himself in a box, so he strays away from putting certain labels on his style. He simply titles it - Painting The Sky,Blew!!! Most say he is a breath of fresh air actually! Although he is VERY UNDERRATED, this young man still perseveres and has built a following that reaches far beyond the borders of this state. Following the narrative \"I Don\'t Rap, I Paint The Sky,Blew!!!\" He\'s the coolest nerd, you ever heard!\r\n\r\n\r\nWe are contacting you about considering SkyBlew as a performer on Rolling Loud Miami or any other upcoming events. He has performed at countless festivals such as: Hopscotch, Art Of Cool, Anime Weekend Atlanta & more! He deserves an opportunity such as this, and the world NEEDS to hear this young man\'s positive message. We GUARANTEE, SkyBlew will put on an UNFORGETTABLE performance!! ☁\r\n\r\n\r\n\r\nSkyBlew\'s music is currently being used by the top anime company - FUNIMATION!!! \r\nSkyBlew is featured on some of the most notable websites in cyberspace such as: 2DopeBoyz, Afropunk, MTV, Impose Magazine, Earmilk, HotNewHipHop, Rapzilla, AXS TV and countless others! Also, he received MAJOR recognition from ReverbNation as a \"Break Out Artist\" in their \"ReverbNation Artists Shine in 2013\" video!\r\nSkyBlew, accompanied by his LIVE JAZZ HOP BAND - The Digi Destined, made HEADLINES after their MEMORABLE performance at the MAJOR, Hopscotch Music Festival 2015, opening for Pusha T! SkyBlew has also, opened for countless MAJOR acts including: Lupe Fiasco, Kendrick Lamar, Curren$y, Flobots, Del The Funky Homosapien, Jedi Mind Tricks, Watsky, Slum Village, MC Chris, Grieves, Wax, MC Lars & many more!! ☁\r\n\r\n\r\n\r\n\r\n🎶 Here\'s one of his albums -  \"SkyBlew The Cowardly Boy\", which has gained critical acclaim! It\'s a COURAGE THE COWARDLY DOG THEMED ALBUM (YES YOU HEARD THAT RIGHT) 🎶🎶\r\nhttp://megaranmusic.com/album/skyblew-the-cowardly-boy 🎶🎶🎶\r\n\r\n\r\nWAS FEATURED ON BANDCAMP\'S FRONT PAGE AS BEST SELLER!!!\r\n\r\n\r\n\r\n\r\nHere are some of his MUSIC VIDEOS: 📺\r\nhttps://www.youtube.com/watch?v=HxzGt9BLQeU (Nefelibata)\r\nhttps://www.youtube.com/watch?v=o0dcoUzGD7U (Galaxy Walk)\r\nhttp://www.youtube.com/watch?v=A4y8lXm_cYQ (Slice of Life)\r\nhttps://www.youtube.com/watch?v=QH5egt8UQPU (SkyBlew Meets Bigfoot)  \r\nhttps://www.youtube.com/watch?v=RK12eoERmyI (The Grey Balloons)\r\nhttp://www.youtube.com/watch?v=HeV434PzVlM (Running In Place) (AWARD WINNING)\r\nhttps://www.youtube.com/watch?v=YKKAf3dzo2Q (Revenge Of The Chicken From Outer Space!)\r\n\r\n\r\n\r\nPERFORMANCE FOOTAGE: 📺\r\nhttps://www.youtube.com/watch?v=R5qwaNfnEks (In Studio Performance)\r\nhttps://www.youtube.com/watch?v=2Yl7Pdpo5T8 (Flowers w/ Jazz Band)\r\nhttps://www.youtube.com/watch?v=JYzCUqMCi4g (Album Release Party Footage)\r\nhttps://www.youtube.com/watch?v=IOUiilM1oZA (Cat\'s Cradle Footage)\r\nhttps://www.youtube.com/watch?v=jRzgGOGskws (Full Set) \r\n\r\n\r\n\r\nSkyBlew is destined for GREAT things! His exposure is growing exponentially on the regional, national, and international levels. With over MILLIONS of views on Youtube, he is painting the sky an elevated shade of BLEW!! His last 3 albums, which were released under Mega Ran\'s imprint - RandomBeats Music, debuted on the Bandcamp front page as BEST SELLERS, in the Hip-Hop category! SkyBlew was also nominated for the NCUMAS (North Carolina Underground Music Awards) 2012 Lyricist Award! His powerful music video/short film \"Running in Place\" won Best Music Video at the Rumschpringe International Short Film Festival, Great Lakes International Film Festival and more! He released multiple albums in South Korea that made it to their TOP 10 CHARTS! Also, he has a song on the album, \"In Ya Mellow Tone 10 Anniversary Best\" that made it to #1 ON JAPAN ITUNES CHARTS!!! The nominations continue to soar! Legendary performances are in the making... Appointed times appear, and with the state of Hip-Hop today, we need more from SkyBlew!\r\n\r\n\r\nYou can hear more of his MUSIC here:\r\nhttps://soundcloud.com/SkyBlewMusic\r\nhttps://skyblew1.bandcamp.com/\r\nhttps://www.youtube.com/SkyBlew\r\n\r\n\r\nSOCIAL MEDIA:\r\nhttps://www.facebook.com/SkyBlewMusic\r\nhttps://twitter.com/HeySkyBlew\r\nhttps://www.sonicbids.com/skyblew (Electronic Press Kit)\r\n\r\n\r\nFeel free to contact me at anytime via email skyblewmusic@gmail.com or phone, 336 684 9645 about the ColorfulDreamer by the name of SkyBlew!!! Good, QUALITY music with a MESSAGE, deserves to be heard, especially in this generation.  \r\n\r\nThank you! Peace, Love & Blessings!  💙✌️\r\n🎨🌥️ -Paint The Sky,Blew!!! 🎨🌥️ \r\n\r\n\r\n\r\n\r\n \r\nAttachments area\r\nPreview YouTube video SkyBlew - Nefelibata (Official Video)\r\n\r\nPreview YouTube video SkyBlew - Slice of Life\r\n\r\nPreview YouTube video SkyBlew - SkyBlew Meets Bigfoot (Official Video)\r\n\r\nPreview YouTube video SkyBlew - The Grey Balloons (Official Video)\r\n\r\nPreview YouTube video SkyBlew - Running In Place (Official Music Video)\r\n\r\nPreview YouTube video SkyBlew - Revenge Of The Chicken From Outer Space! (Official Video)\r\n\r\nPreview YouTube video SkyBlew (Full Set) - WKNC\'s The Lounge\r\n\r\nPreview YouTube video SkyBlew and Small House- Flowers (Nujabes Cover)\r\n\r\nPreview YouTube video Live @ Cat\'s Cradle pt3\r\n\r\nPreview YouTube video Skyblew Show pt 2\r\n\r\nPreview YouTube video SkyBlew & The Digi-Destined @ 88.1 WKNC Double Barrel Benefit', 'free_booking', NULL, NULL, '0', NULL, 0, NULL, '2019-04-30 00:25:16', '2019-04-30 00:25:16', NULL),
